import React, { useState, useEffect } from "react";
import axios from "axios";
import { useSelector } from 'react-redux';
import products from '../reducers/products';
import { BsFileEarmarkPlusFill } from "react-icons/bs";
import ProModalNew from "./newproductmodal";


function ProdcutTable() {
    var productIndex = 0;

    const products = useSelector((state) => state.products);
    console.log(products);

    let editModals = products.map((pro) => {
        return (
            <React.Fragment>
                <ProModalNew 
                    key={pro._id}
                    productId={pro._id}
                    name={pro.name}
                    manufacturer={pro.manufacturer}
                    style={pro.style}
                    purchasePrice={pro.purchasePrice}
                    salePrice={pro.salePrice}
                    commisionPercentage={pro.commisionPercentage}
                />
            </React.Fragment>
        )
    })

	let proRow = products.map((pro) => {
		var rowColor;

		if (productIndex++ % 2 == 0) {
			rowColor = "dark:bg-stone-700";
		} else {
			rowColor = "dark:bg-stone-600";
		}
		return (
			<tr className={`bg-white ${rowColor} `}>
				<th
					scope="row"
					className="px-2 py-4 font-medium text-gray-900 dark:text-white whitespace-nowrap"
				>
					{pro.Name}
				</th>
				<th scope ="row" className="px-2 py-4 font-medium text-gray-900 dark:text-white whitespace-nowrap">
					Manufacturer
				</th>
				<th scope="row" className="px-2 py-4 font-medium text-gray-900 dark:text-white whitespace-nowrap">
					Style
				</th>
				<th scope="row" className="px-2 py-4 font-medium text-gray-900 dark:text-white whitespace-nowrap">
					Purchase Price
				</th>
                <th scope="row" className="px-2 py-4 font-medium text-gray-900 dark:text-white whitespace-nowrap">
					Sale Price
				</th>
                <th scope="row" className="px-2 py-4 font-medium text-gray-900 dark:text-white whitespace-nowrap">
					Quantity
				</th>
                <th scope="row" className="px-2 py-4 font-medium text-gray-900 dark:text-white whitespace-nowrap">
					Commision Percent
				</th>
				<td className="px-2 py-4 whitespace-nowrap">
					<div className="grid grid-cols-2 content-center">
						<button
							data-bs-toggle="modal"
							data-bs-target={`#editModal`}
							className="flex-right px-3 py-2 justify-self-center h-full bg-green-600 hover:bg-green-700 text-white transition ease-in duration-200 text-center text-base font-semibold shadow-md focus:outline-none rounded-lg "
						>
							Edit
						</button>
						<button
							data-bs-toggle="modal"
							data-bs-target={`#deleteModal`}
							className="px-1 py-2 justify-self-center h-full whitespace-nowrap bg-red-600 hover:bg-red-700 text-white transition ease-in duration-200 text-center text-base font-semibold shadow-md focus:outline-none rounded-lg "
						>
							Delete
						</button>
						
					</div>
				</td>
			</tr>
		);
	});

	return (
		<div className="mt-10 relative  shadow-md sm:rounded-lg h-full overflow-visible">
			<table className="w-full text-sm text-center text-gray-500 dark:text-gray-50">
				<thead className="text-xs text-white-700 uppercase bg-white-50 dark:bg-white-700 dark:text-white-400 dark:bg-stone-800">
					<tr>
						<th scope="col" className="px-2 py-4">
							Name
						</th>
						<th scope="col" className="px-2 py-4">
							Manufacturer
						</th>
						<th scope="col" className="px-2 py-4">
							Style
						</th>
						<th scope="col" className="px-2 py-4">
							Purchase Price
						</th>
						<th scope="col" className="px-2 py-4">
							Purchase Price
						</th>
						<th scope="col" className="px-2 py-4">
							Sale Price
						</th>
                        <th scope="col" className="px-2 py-4">
							Quantity
						</th>
                        <th scope="col" className="px-2 py-4">
							Commision Percent
						</th>
						<th
							scope="col"
							className="relative h-full flex items-center justify-end py-3"
						>
                            
							<button
								data-bs-toggle="modal"
								data-bs-target="#newModal"
								className="absolute object-none text-xs mb-8 w-10 h-10 flex items-center justify-center rounded-full bg-green-600 hover:bg-green-700 focus:ring-green-500 focus:ring-offset-green-200 text-white hover:scale-110 transition ease-in duration-200 text-center text-base font-semibold shadow-md"
							>
								Add New
							</button>
                            {editModals}
                            <ProModalNew/>
						</th>
					</tr>
				</thead>
				<tbody>{proRow}</tbody>
			</table>
		</div>
	);
}
export default ProdcutTable;
